(window.webpackJsonp=window.webpackJsonp||[]).push([[343],{547:function(t,e,n){"use strict";n.r(e);var a=n(5),o=Object(a.a)({},(function(){var t=this,e=t.$createElement,n=t._self._c||e;return n("ContentSlotsDistributor",{attrs:{"slot-key":t.$parent.slotKey}},[n("h2",{attrs:{id:"software-caused-connection-abort-socket-write-error-httpclient-java"}},[n("a",{staticClass:"header-anchor",attrs:{href:"#software-caused-connection-abort-socket-write-error-httpclient-java"}},[t._v("#")]),t._v(" Software caused connection abort: socket write error|httpClient|JAVA")]),t._v(" "),n("p",[n("strong",[t._v("问题发现")]),n("br"),t._v("\n执行http请求的定时任务，发现任务间歇性不触发，打断点发现服务器根本没有接收到本系统的请求，初步断定时客户端的问题，最后将问题定位到httpClient类。")]),t._v(" "),n("p",[n("strong",[t._v("解决方案")]),n("br"),t._v("\n所使用的HttpClient版本为4.4。将其升级至4.4.1即可。")]),t._v(" "),n("p",[n("strong",[t._v("问题定义")]),n("br"),t._v("\n为了避免以后出现类似的问题，需要搞清楚根本问题出现在哪里，以及如何避免")]),t._v(" "),n("ol",[n("li",[t._v("查阅HttpClient4.4.1版本中值得注意之处")])]),t._v(" "),n("div",{staticClass:"custom-block tip"},[n("p",{staticClass:"custom-block-title"},[t._v("httpClient4.4.1RELEASE_NOTES")]),t._v(" "),n("p",[n("a",{attrs:{href:"https://svn.apache.org/viewvc/httpcomponents/httpclient/tags/4.4.1/RELEASE_NOTES.txt?revision=1670120&view=markup&pathrev=1670120",target:"_blank",rel:"noopener noreferrer"}},[t._v("4.4.1 final release notes"),n("OutboundLink")],1)])]),t._v(" "),n("div",{staticClass:"language- extra-class"},[n("pre",{pre:!0,attrs:{class:"language-text"}},[n("code",[t._v("1 \tRelease 4.4.1 版本 4.4.1\n2 \t-------------------\n3 \t\n4 \tHttpClient 4.4.1 (GA) is a maintenance release that fixes a number of defects in new functionality\nHttpClient 4.4.1 （GA） 是一个维护版本，它修复了新功能中的许多缺陷\n5 \tintroduced in version 4.4.\n在版本 4.4 中引入。\n6 \t\n7 \tUsers of HttpClient 4.4 are encouraged to upgrade.\n鼓励 HttpClient 4.4 的用户升级。\n8 \t\n9 \tPlease note that as of 4.4 HttpClient requires Java 1.6 or newer.\n请注意，从 4.4 开始，HttpClient 需要 Java 1.6 或更高版本。\n10 \t\n11 \tChangelog: 更新日志：\n12 \t-------------------\n13 \t\n14 \t* Marked RFC 2109, RFC 2965, Netscape draft cookie specs as obsolete\n* 将 RFC 2109、RFC 2965、Netscape 草案 cookie 规范标记为已过时\n15 \t  Contributed by Oleg Kalnichevski <olegk at apache.org>\n供稿人：Oleg Kalnichevski <olegk at apache.org>\n16 \t\n17 \t* [HTTPCLIENT-1633] RFC6265CookieSpecProvider compatibility level setting has no effect.\n* [HTTPCLIENT-1633] RFC6265CookieSpecProvider 兼容级别设置不起作用。\n18 \t  Contributed by Oleg Kalnichevski <olegk at apache.org>\n供稿人：Oleg Kalnichevski <olegk at apache.org>\n19 \t\n20 \t* [HTTPCLIENT-1628]: Auth cache can fail when domain name contains uppercase characters.\n* [HTTPCLIENT-1628]：当域名包含大写字符时，身份验证缓存可能会失败。\n21 \t  Contributed by Dennis Ju <dejuknow at gmail.com>\n供 稿 人：Dennis Ju <dejuknow at gmail.com>\n22 \t\n23 \t* [HTTPCLIENT-1609] Stale connection check in PoolingHttpClientConnectionManager has no effect.\n* [HTTPCLIENT-1609] PoolingHttpClientConnectionManager 中的过时连接检查不起作用。\n24 \t  Internal connection pool does not correctly implement connection validation.\n内部连接池未正确实现连接验证。\n25 \t  Contributed by Charles Lip <rene1 at singnet.com.sg>\n供稿人：Charles Lip <rene1 at singnet.com.sg>\n26 \t\n27 \t\n28 \t\n29 \tRelease 4.4 Final 版本 4.4 最终版\n30 \t-------------------\n31 \t\n32 \tThis is the first stable (GA) release of HttpClient 4.4. Notable features and enhancements included\n这是 HttpClient 4.4 的第一个稳定 （GA） 版本。包括值得注意的功能和增强功能\n33 \tin 4.4 series are: 在 4.4 系列中有：\n34 \t\n35 \t* Support for the latest HTTP state management specification (RFC 6265). Please note that the old \n* 支持最新的 HTTP 状态管理规范 （RFC 6265）。请注意，旧的\n36 \tcookie policy is still used by default for compatibility reasons. RFC 6265 compliant cookie \n出于兼容性原因，默认情况下仍使用 Cookie 策略。符合 RFC 6265 的 Cookie\n37 \tpolicies need to be explicitly configured by the user. Please also note that as of next feature \n策略需要由用户显式配置。另请注意，从下一个功能开始\n38 \trelease support for Netscape draft, RFC 2109 and RFC 2965 cookie policies will be deprecated \n对 Netscape 草案、RFC 2109 和 RFC 2965 cookie 策略的发布支持将被弃用\n39 \tand disabled by default. It is recommended to use RFC 6265 compliant policies for new applications \n并默认禁用。建议对新应用程序使用符合 RFC 6265 的策略\n40 \tunless compatibility with RFC 2109 and RFC 2965 is required and to migrate existing applications \n除非需要与 RFC 2109 和 RFC 2965 兼容并迁移现有应用程序\n41 \tto the default cookie policy.\n添加到默认的 Cookie 策略。\n42 \t\n43 \t* Enhanced, redesigned and rewritten default SSL hostname verifier with improved RFC 2818\n* 使用改进的 RFC 2818 增强、重新设计和重写了默认 SSL 主机名验证器\n44 \tcompliance 合规\n45 \t\n46 \t* Default SSL hostname verifier and default cookie policy now validate certificate identity \n* 默认 SSL 主机名验证程序和默认 cookie 策略现在验证证书身份\n47 \tand cookie domain of origin against the public suffix list maintained by Mozilla.org\n以及针对 Mozilla.org 维护的公共后缀列表的 cookie 来源域\n48 \t<https://publicsuffix.org/list>\n49 \t\n50 \t* More efficient stale connection checking: indiscriminate connection checking which results\n* 更高效的过时连接检查：不分青红皂白的连接检查结果\n51 \tin approximately 20 to 50 ms overhead per request has been deprecated in favor of conditional\n在大约 20 到 50 毫秒内，每个请求的开销已被弃用，取而代之的是有条件的\n52 \tconnection state validation (persistent connections are to be re-validated only if a specified\n连接状态验证（仅当指定\n53 \tperiod inactivity has elapsed)\n期间不活动已过去）\n54 \t\n55 \t* Authentication cache thread-safety: authentication cache used by HttpClient is now thread-safe\n* 身份验证缓存线程安全：HttpClient 使用的身份验证缓存现在是线程安全的\n56 \tand can be shared by multiple threads in order to re-use authentication state for subsequent\n并且可以由多个线程共享，以便重用身份验证状态以供后续使用\n57 \trequests 请求\n58 \t\n59 \t* Native Windows Negotiate and NTLM via SSPI through JNA: when running on Windows OS HttpClient\n* 通过 SSPI 通过 JNA 的本机 Windows 协商和 NTLM：在 Windows 操作系统 HttpClient 上运行时\n60 \tconfigured to use native NTLM or SPNEGO authentication schemes can make use of platform specific\n配置为使用本机 NTLM 或 SPNEGO 认证方案可以使用特定于平台的认证方案\n61 \tfunctionality via JNA and current user credentials. This functionality is still considered\n通过 JNA 和当前用户凭据实现的功能。此功能仍被考虑在内\n62 \texperimental, known to have compatibility issues and subject to change without prior notice.\n实验性，已知存在兼容性问题，如有更改，恕不另行通知。\n63 \tUse at your discretion. 自行决定使用。\n64 \t\n65 \tThis release also includes all fixes from the stable 4.3.x release branch.\n此版本还包括稳定版 4.3.x 版本分支中的所有修复。\n66 \t\n67 \tPlease note that as of 4.4 HttpClient requires Java 1.6 or newer.\n请注意，从 4.4 开始，HttpClient 需要 Java 1.6 或更高版本。\n68 \t\n69 \t\n70 \tChangelog: 更新日志：\n71 \t-------------------\n72 \t\n73 \t* Support for the latest HTTP state management specification (RFC 6265).\n* 支持最新的 HTTP 状态管理规范 （RFC 6265）。\n74 \t  Contributed by Oleg Kalnichevski <olegk at apache.org>\n供稿人：Oleg Kalnichevski <olegk at apache.org>\n75 \t\n76 \t* [HTTPCLIENT-1515] Caching of responses to HEAD requests\n* [HTTPCLIENT-1515] 缓存对 HEAD 请求的响应\n77 \t  Contributed by Tyrone Cutajar <tj.cutajar at gmail.com> and \n供稿人：Tyrone Cutajar <tj.cutajar at gmail.com> 和\n78 \t  Francois-Xavier Bonnet <fx at apache.org> \n79 \t\n80 \t* [HTTPCLIENT-1560] Native Windows auth improvements\n* [HTTPCLIENT-1560] 本机 Windows 身份验证改进\n81 \t  Contributed by Michael Osipov <michaelo at apache.org>\n供稿人：Michael Osipov <michaelo at apache.org>\n82 \t\n83 \t* Update Apache Commons Logging version from 1.1.3 to 1.2. \n* 将 Apache Commons Logging 版本从 1.1.3 更新到 1.2。\n84 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n85 \t\n86 \t* Update Apache Commons Codec version from 1.6 to 1.9. \n* 将 Apache Commons 编解码器版本从 1.6 更新到 1.9。\n87 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n88 \t\n89 \t* Update Ehcache version from 2.2.0 to 2.6.9. \n* 将 Ehcache 版本从 2.2.0 更新到 2.6.9。\n90 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n91 \t\n92 \t* Update Ehcache version from 2.2.0 to 2.6.9. \n* 将 Ehcache 版本从 2.2.0 更新到 2.6.9。\n93 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n94 \t\n95 \t* Update Spymemcached version from 2.6 to 2.11.4. \n* 将 Spymemcached 版本从 2.6 更新到 2.11.4。\n96 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n97 \t\n98 \t* Update SLF4J version from 1.5.11 to 1.7.7. \n* 将 SLF4J 版本从 1.5.11 更新到 1.7.7。\n99 \t  Contributed by Gary Gregory <ggregory at apache.org>\n供稿人：Gary Gregory <ggregory at apache.org>\n\n")])])])])}),[],!1,null,null,null);e.default=o.exports}}]);